import React from 'react';
import Col from 'react-bootstrap/Col';

const Associated = ({first_name}) => {

    return (
        <Col className="">
            <img alt={first_name} src="https://loremflickr.com/320/240/person?random=1" />
        </Col>
    );
}

export default Associated;
